We hold a state which tracks the currently ongoing recovery tasks, as well as which request IDs correspond to which task. A recovery task is a structure encapsulating all recovery tasks with the network necessary to recover the available data in respect to one candidate. struct State { /// Each recovery is implemented as an independent async task, and the handles only supply information about the result. ongoing_recoveries: FuturesUnordered<RecoveryHandle>, /// A recent block hash for which state should be available. live_block_hash: Hash, // An LRU cache of recently recovered data. availability_lru: LruCache<CandidateHash, Result<AvailableData, RecoveryError>>,
} /// This is a future, which concludes either when a response is received from the recovery tasks,
/// or all the `awaiting` channels have closed.
struct RecoveryHandle { candidate_hash: CandidateHash, interaction_response: RemoteHandle<Concluded>, awaiting: Vec<ResponseChannel<Result<AvailableData, RecoveryError>>>,
} struct Unavailable;
struct Concluded(CandidateHash, Result<AvailableData, RecoveryError>); struct RecoveryTaskParams { validator_authority_keys: Vec<AuthorityId>, validators: Vec<ValidatorId>, // The number of pieces needed. threshold: usize, candidate_hash: Hash, erasure_root: Hash,
} enum RecoveryTask { RequestFromBackers { // a random shuffling of the validators from the backing group which indicates the order // in which we connect to them and request the chunk. shuffled_backers: Vec<ValidatorIndex>, } RequestChunksFromValidators { // a random shuffling of the validators which indicates the order in which we connect to the validators and // request the chunk from them. shuffling: Vec<ValidatorIndex>, received_chunks: Map<ValidatorIndex, ErasureChunk>, requesting_chunks: FuturesUnordered<Receiver<ErasureChunkRequestResponse>>, }
} struct RecoveryTask { to_subsystems: SubsystemSender, params: RecoveryTaskParams, source: Source,
}

