The database schema is designed with the following goals in mind: To provide an easy index from unfinalized blocks to candidates To provide a lookup from candidate hash to approval status To be easy to clear on start-up. What has happened while we were offline is unimportant. To be fast to clear entries outdated by finality Structs: struct TrancheEntry { tranche: DelayTranche, // assigned validators who have not yet approved, and the instant we received // their assignment. assignments: Vec<(ValidatorIndex, Tick)>,
} struct OurAssignment { cert: AssignmentCert, tranche: DelayTranche, validator_index: ValidatorIndex, triggered: bool,
} struct ApprovalEntry { tranches: Vec<TrancheEntry>, // sorted ascending by tranche number. backing_group: GroupIndex, our_assignment: Option<OurAssignment>, our_approval_sig: Option<ValidatorSignature>, assignments: Bitfield, // n_validators bits approved: bool,
} struct CandidateEntry { candidate: CandidateReceipt, session: SessionIndex, // Assignments are based on blocks, so we need to track assignments separately // based on the block we are looking at. block_assignments: HashMap<Hash, ApprovalEntry>, approvals: Bitfield, // n_validators bits
} struct BlockEntry { block_hash: Hash, session: SessionIndex, slot: Slot, // random bytes derived from the VRF submitted within the block by the block // author as a credential and used as input to approval assignment criteria. relay_vrf_story: [u8; 32], // The candidates included as-of this block and the index of the core they are // leaving. Sorted ascending by core index. candidates: Vec<(CoreIndex, Hash)>, // A bitfield where the i'th bit corresponds to the i'th candidate in `candidates`. // The i'th bit is `true` iff the candidate has been approved in the context of // this block. The block can be considered approved has all bits set to 1 approved_bitfield: Bitfield, children: Vec<Hash>,
} // slot_duration * 2 + DelayTranche gives the number of delay tranches since the
// unix epoch.
type Tick = u64; struct StoredBlockRange(BlockNumber, BlockNumber); In the schema, we map "StoredBlocks" => StoredBlockRange
BlockNumber => Vec<BlockHash>
BlockHash => BlockEntry
CandidateHash => CandidateEntry

