We use an underlying Key-Value database where we assume we have the following operations available: write(key, value) read(key) -> Option<value> iter_with_prefix(prefix) -> Iterator<(key, value)> - gives all keys and values in lexicographical order where the key starts with prefix. We use this database to encode the following schema: ("available", CandidateHash) -> Option<AvailableData>
("chunk", CandidateHash, u32) -> Option<ErasureChunk>
("meta", CandidateHash) -> Option<CandidateMeta> ("unfinalized", BlockNumber, BlockHash, CandidateHash) -> Option<()>
("prune_by_time", Timestamp, CandidateHash) -> Option<()> Timestamps are the wall-clock seconds since Unix epoch. Timestamps and block numbers are both encoded as big-endian so lexicographic order is ascending. The meta information that we track per-candidate is defined as the CandidateMeta struct struct CandidateMeta { state: State, data_available: bool, chunks_stored: Bitfield,
} enum State { /// Candidate data was first observed at the given time but is not available in any block. Unavailable(Timestamp), /// The candidate was first observed at the given time and was included in the given list of unfinalized blocks, which may be /// empty. The timestamp here is not used for pruning. Either one of these blocks will be finalized or the state will regress to /// `State::Unavailable`, in which case the same timestamp will be reused. Unfinalized(Timestamp, Vec<(BlockNumber, BlockHash)>), /// Candidate data has appeared in a finalized block and did so at the given time. Finalized(Timestamp)
} We maintain the invariant that if a candidate has a meta entry, its available data exists on disk if data_available is true. All chunks mentioned in the meta entry are available. Additionally, there is exactly one prune_by_time entry which holds the candidate hash unless the state is Unfinalized. There may be zero, one, or many "unfinalized" keys with the given candidate, and this will correspond to the state of the meta entry.

